import { PublicKey } from '@solana/web3.js';
import React, { useEffect, useState } from 'react';
import {StyleSheet, View, Image, ScrollView} from 'react-native';
import {Divider, Text} from 'react-native-paper';
const ddd ="data:application/octet-stream;base64,"
type Props = Readonly<{
    publicKey: PublicKey;
  }>;
  
const AccountTokenBalances = ({publicKey}) => {
  const [assets, setAssets] = useState<any[]>([]);
  const [nfts, setNfts] = useState<any[]>([]);
  const [tokenPrices, setTokenPrices] = useState({});

  // Function to fetch token prices from Jupiter Price API
  const fetchTokenPrices = async (tokenIds) => {
    try {
      const response = await fetch(`https://price.jup.ag/v4/price?ids=${tokenIds.join(',')}`);
      const data = await response.json();
      return data.data;
    } catch (error) {
      console.error('Error fetching token prices:', error);
      return {};
    }
  };

  useEffect(() => {
    const fetchAssets = async () => {
      const response = await fetch("https://jarrett-solana-7ba9.mainnet.rpcpool.com/8d890735-edf2-4a75-af84-92f7c9e31718", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          jsonrpc: '2.0',
          id: 'my-id',
          method: 'searchAssets',
          params: {
            ownerAddress: publicKey.toBase58(),
            page: 1,
            tokenType: "all"
          },
        }),
      });
      const { result } = await response.json();
      const nonNfts = result.items.filter(asset => asset.interface == "FungibleToken");
      nonNfts.forEach(async (nft) => {
        try {
            
            if (nft.content.links.image == null) {
                nft.content.links.image = ddd;
            }

            if (nft.token_info.symbol == "USDC"){
                nft.content.links.image = "https://cryptologos.cc/logos/usd-coin-usdc-logo.png?v=029"
            }
            else {
            const imageResponse = await fetch(nft.content.links.image);
            const imageBlob = await imageResponse.blob();
            
            const reader = new FileReader();
            reader.onloadend = function() {
                const base64data = reader.result;
                nft.content.links.image = base64data;
            }
            reader.readAsDataURL(imageBlob);
        }
        } catch (error) {
          console.error('Fetch error:', error);
        }
      });
      // Fetch prices for the assets
      const prices = await fetchTokenPrices(result.items.map(asset => asset.id));

      // multiply out prices by asset.supply
        Object.keys(prices).forEach((key) => {
            try {
                if (nonNfts.find(asset => asset.id == key)){
                prices[key].price = prices[key].price * nonNfts.find(asset => asset.id == key).token_info.balance / 10 ** nonNfts.find(asset => asset.id == key).token_info.decimals;
                }
            } catch (error) {
                console.log(error);
            }
            });
        console.log(prices)

      setTokenPrices(prices);
      setAssets(nonNfts);
      const nfts = result.items.filter(asset => asset.interface != "FungibleToken" && asset.supply == 1);
    // the asset.content.links.image is a redirect from ipfs, arweave, or something else
    // we need to fetch the image and store it in the asset object
    // then we can display the image in the app
    // fetch the image
    nfts.forEach(async (nft) => {
        try {

            if (nft.content.links.image == null) {
                nft.content.links.image = ddd;
            }
            else {
            const imageResponse = await fetch(nft.content.links.image);
            const imageBlob = await imageResponse.blob();
            
            const reader = new FileReader();
            reader.onloadend = function() {
                const base64data = reader.result;
                console.log(base64data);
                nft.content.links.image = base64data;
            }
            reader.readAsDataURL(imageBlob);
        }
            
        } catch (error) {
          console.error('Fetch error:', error);
        }
      });
    setNfts(nfts);

    };

    fetchAssets();
  }, []);

  return (
    <View>
      <Text>Account Token Balances</Text>
      <ScrollView >
      {assets.length > 0 && assets.map((asset: any, index) => (
        <View key={index}>

<Image
      source={{ uri: asset.content.links.image }}
      defaultSource={{ uri: ddd }} 
      style={{ width: 66, height: 58 }}
    />
              <Text>Asset: {asset.token_info.symbol}</Text>
          <Text>Balance: {asset.token_info.balance / 10 ** asset.token_info.decimals}</Text>
          <Text>$USD: {tokenPrices[asset.id]?.price}</Text>
        </View>
      ))}

        <Text>Account NFT Balances</Text>
        {nfts.length > 0 && nfts.map((nft: any, index) => (
            <View key={index}>
                <Image source={{uri:  nft.content.links.image}} 
                      defaultSource={{ uri: ddd }} 

style={{ width: 66, height: 58 }}/>
                <Text>NFT: {nft.id}</Text>
            </View>
        ))}
        </ScrollView>
        
    </View>
  );
};

export default AccountTokenBalances;
